import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <form>
        <div style="margin">
        <input type="text" label="name"/>
        </div>
        <div>
        <input type="password" label="password"/>
        </div>
     <button>Login</button>
     </form>
    </div>
  );
}

export default App;
